import React, {Component} from 'react';

class Sam1 extends Component {
    constructor() {
      super();
      this.state = {
        message: "Hai I am Siva"
      };
    }
    render() {
      return (
        <div>
          <h1> {this.state.message}</h1>
        </div>
      );
    }
  }
export default Sam1;
